import React from "react";



const ButtonLink = styled.button
`
    color: white;
     width: 70px;
     height: 30px;
     border:none;
     border:solid 2px white;
     border-radius: 5px;
     background: rgba(255, 255, 255,0);
     font-size: 10px;
     margin: 10px 20px;
     &:hover {
        border:solid 2px black;
        cursor: pointer;
        
      }
`

const useStyles = makeStyles(() => ({
    root: {
      flexGrow: 1,
      
    },
    title: {
      flexGrow: 0.9,
      fontFamily:
          'roboto',
          fontWeight: 70,
    },
  }));

export default function Header(){
    const classes = useStyles();

    return(
        <div>
            <AppBar style={{ background: '#0bcaa1' }}>
                <Toolbar >
                    <Typography  className={classes.title}>
                        Kelompok 47
                    </Typography>
                    <ButtonLink>
                            Link
                    </ButtonLink>
                    <ButtonLink >
                            Link
                    </ButtonLink>
                </Toolbar>
            </AppBar>
        </div>
       
    )
}
